import React from "react";
import Login from "./login";

function Register () {

    return(
        <div className="body">
        <div className="mainclass">
            <h1 className="header">Register Page</h1>
            
            <input className = "input" type = "text" name = "Username" placeholder="Username"/><br /><br/>
            <input className = "input" type = "password" name = "Password" placeholder="Password" /><br /><br/>
           <a href = "./login"> <button className="button-5" onClick={Login} type = "submit"> Submit </button></a>

        </div>
        </div>
    )
}


export default Register;
